import gql from 'graphql-tag';

//Query para el discograf

export const songs_query = gql ` query {
    getSongs {
        id
        filename
        duracion
    }
}`

export const song_query = gql ` query {
    getSong(id:"5da50296c0419924d03052ff"){
        id
        filename
        originalname
        contentType
        duracion
        source
    }
}`
